SELECT MAX("lineorder"."lo_discount") as agg_0, MIN("part"."p_partkey") as agg_1, MIN("lineorder"."lo_tax" + "lineorder"."lo_discount") as agg_2 FROM "supplier" LEFT OUTER JOIN "lineorder" ON "supplier"."s_suppkey" = "lineorder"."lo_suppkey" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey"  WHERE ("lineorder"."lo_custkey" <= 9679 OR "lineorder"."lo_supplycost" <= 61028 OR "lineorder"."lo_custkey" BETWEEN 33523 AND 58872) AND ("lineorder"."lo_orderpriority" != '5-LOW' OR "lineorder"."lo_orderkey" >= 7489931) AND "supplier"."s_nation" = 'ROMANIA' AND "part"."p_mfgr" LIKE '%MFGR#4%' AND "part"."p_catery" NOT LIKE '%MFGR#31%' AND "supplier"."s_suppkey" >= 1866